import React, { Component } from 'react';
import NavMenu from './components/Navbar/NavMenu';
import { Route, Switch } from "react-router-dom";
import NutritionAnalysis from './components/Navbar/Pages/NutritionAnalysis';
import Recipes from './components/Navbar/Pages/Recipes';
import Mbi from './components/Navbar/Pages/Mbi';
import Articles from './components/Navbar/Pages/Articles';
import SignUpPage from './components/Navbar/Pages/SignUpPage';
import SignUpForm from './components/Account/SignUpForm'; 
import SignInForm from './components/Account/SignInForm';

class App extends Component {
  constructor() {
    super();
  }
  render() {
    return (
      <div >


        <NavMenu />


        <Switch>
          <Route path="/" exact>
            <h1>Hallo hier ist Tareq</h1>
          </Route>

          <Route path='/nutrition-analysis'>
            <NutritionAnalysis />
          </Route>

          <Route path='/recipes'>
            <Recipes />
          </Route>

          <Route path='/mbi'>
            <Mbi />
          </Route>

          <Route path='/articles'>
            <Articles />
          </Route>

          <Route path='/sign-up'>
            <SignUpPage />
          </Route>

          <Route path='/sign-up'>
            <SignUpPage />
          </Route>



        </Switch>


      </div>
    );
  }
}


export default App;
